<template>
  <div id="app">
    <div class="homepage">
      <div class="title">
        <div class="line">自动生成融为一体的</div>
        <div class="line bold">微博主页封面和背景图</div>
        <label class="btn" for="uploads">马上试试</label>
        <input type="file"
           id="uploads"
           style="position:absolute; clip:rect(0 0 0 0);"
           accept="image/png, image/jpeg, image/gif, image/jpg"
           @change="uploadImg($event)">
        <div class="tips">建议上传 1800×1500 px 以上的图片</div> 
      </div>
      <img src="./assets/cover.png" class="cover">
    </div>
    
    <transition name="fade">
      <div class="crop-modal" v-if="cropModal">
        <div class="mask" @click="closeCropModal"></div>
        <div class="wrap">
          <div class="close-btn" @click="closeCropModal">×</div>
          <div class="preview">
            <img src="./assets/demo.png" class="demo">
            <vue-cropper ref="cropper"
                         :img="option.img"
                         :output-size="option.size"
                         :output-type="option.outputType"
                         :info="true"
                         :full="option.full"
                         :can-move="option.canMove"
                         :can-move-box="option.canMoveBox"
                         :fixed-box="option.fixedBox"
                         :original="option.original"
                         :auto-crop="option.autoCrop"
                         :auto-crop-width="option.autoCropWidth"
                         :auto-crop-height="option.autoCropHeight"
                         :center-box="option.centerBox"
                         :high="option.high">
             </vue-cropper>
          </div>
          <div class="toolbar">
            <button @click="rotateLeft" class="option">旋转</button>
            <button @click="changeScale(1)" class="option">放大</button>
            <button @click="changeScale(-1)" class="option">缩小</button>
            <a @click="download('base64')" class="btn bottom">调整完成</a>
          </div>
        </div>
      </div>
    </transition>

    <transition name="fade">
      <div class="intro-modal" v-if="introModal">
        <div class="mask" @click="closeIntroModal"></div>
        <div class="wrap">
          <div class="close-btn" @click="closeIntroModal">×</div>
          <div class="header" v-if="this.introContent === 'all'">
            <div class="title">✅ 已开始下载</div>
            <div class="subtitle">分为「微博背景图.jpeg」「微博封面图.jpeg」两张图片，请允许浏览器授权</div>
          </div>
          <div class="part" v-if="this.introContent === 'all' || this.introContent === 'tutorial'">
            <img src="./assets/part-1.jpg">
            <div class="name">如何设置封面图？</div>
            <div class="text">0. 需要开通微博会员</div>
            <div class="text">1. 点击「上传封面图」按钮，上传「微博封面图.jpeg」</div>
            <div class="text">2. 点击「确认」</div>
          </div>
          <div class="part" v-if="this.introContent === 'all' || this.introContent === 'tutorial'">
            <img src="./assets/part-2.jpg">
            <div class="name">如何设置背景图？</div>
            <div class="text">1. 点击右上角「模版设置」按钮</div>
            <div class="text">2. 点击「自定义」</div>
            <div class="text">3. 点击上传照片，上传「微博背景图.png」</div>
            <div class="text">4. 点击「确认」</div>
          </div>
          <div class="part" v-if="this.introContent === 'all' || this.introContent === 'reward'">
            <img src="./assets/part-3.jpg">
            <div class="name">如果对你有帮助</div>
            <div class="text">可以请我喝杯咖啡☕️，赞赏金额随意</div>
          </div>
        </div>
      </div>
    </transition>

    <div class="link-group">
      <a @click="downloadTemplate">下载设计模版</a>
      <a @click="openIntroModal('tutorial')">查看教程</a>
      <a @click="openIntroModal('reward')">赞赏</a>
    </div>
  </div>

</template>

<script>
import { VueCropper } from 'vue-cropper' 

export default {
  name: 'app',
  components: {
    VueCropper,
  },
  data() {
    return {
      cropModal: false,
      introModal: false,
      introContent: '',
      option: {
        img: '',
        size: 0.9,
        full: false,
        outputType: 'jpeg',
        canMove: true,
        fixedBox: true,
        original: false,
        canMoveBox: false,
        autoCrop: true,
        autoCropWidth: 1800,
        autoCropHeight: 1500,
        centerBox: false,
        high: false
      },
    }
  },
  methods: {
    rotateLeft() {
      this.$refs.cropper.rotateLeft()
    },
    changeScale(num) {
      num = num || 1
      this.$refs.cropper.changeScale(num)
    },
    download () {
      var aLink = document.createElement('a')
      aLink.download = '微博背景图'
      var bLink = document.createElement('a')
      bLink.download = '微博封面图'

      this.$refs.cropper.getCropData((data) => {
        aLink.href = data
        aLink.click()

        const image = new Image();
        const canvas = document.createElement("canvas");
        const ctx = canvas.getContext("2d");
        image.src = data;
        image.onload = () => {
          canvas.width = 920;
          canvas.height = 300;
          ctx.drawImage(image,440,66,920,300,0,0,920,300);
          bLink.href = canvas.toDataURL("image/jpeg")
          setTimeout(() => {
            bLink.click()
          }, 500)
        }
      })
      this.cropModal = false
      this.openIntroModal('all')
    },
    uploadImg(e) {
      var file = e.target.files[0]
      var reader = new FileReader()
      reader.onload = (e) => {
        this.cropModal = true
        let data
        if (typeof e.target.result === 'object') {
          data = window.URL.createObjectURL(new Blob([e.target.result]))
        } else {
          data = e.target.result
        }
        this.option.img = data
      }
      reader.readAsArrayBuffer(file)
    },
    closeCropModal () {
      this.cropModal = false;
      this.option.img = '';
      document.getElementById("uploads").value = ''
    },
    openIntroModal (e) {
      this.introModal = true;
      this.introContent = e
    },
    closeIntroModal () {
      this.introModal = false;
    },
    downloadTemplate () {
      var aLink = document.createElement('a')
      aLink.download = '设计模版'
      aLink.href = 'data:image/png;base64,'
      aLink.click()
    }
  },
}

</script>

